INSERT INTO `obo_checklist_master` VALUES ('A01','ARCHITECTURAL',NULL,10,'Needed requirements {s} before {d}','REQUIREMENTS',NULL,0),('AO-001',NULL,'BUILDING:ARCHITECTURAL',1,'Additional rooms/partitions/floor level','GENERAL',NULL,0),('AO-002',NULL,'BUILDING:ARCHITECTURAL',2,'Orientation of the floor plan/site development plan was changed','GENERAL',NULL,0),('AO-003',NULL,'BUILDING:ARCHITECTURAL',3,'Parking space is less than the given approved plan','GENERAL',NULL,0),('AO-004',NULL,'BUILDING:ARCHITECTURAL',4,'No parking space allocated for PWD','GENERAL',NULL,0),('AO-005',NULL,'BUILDING:ARCHITECTURAL',5,'No PWD logo on ( {n} ramp/ {n} parking)','GENERAL',NULL,0),('ARCH01',NULL,'BUILDING:ARCHITECTURAL',0,'Document items requires engineering design and site plan','DOCUMENT',NULL,0),('ARCH02',NULL,'BUILDING:ARCHITECTURAL',1,'Document needs to be excluded in neutral format.','DOCUMENT',NULL,0),('ARCH03',NULL,'BUILDING:ARCHITECTURAL',3,'This is a sample requirement. Parking space must not exceed {n} sq meters. ','DOCUMENT',NULL,0),('ARCH05',NULL,'BUILDING:ARCHITECTURAL',10,'Lacking needed requirements','DOCUMENT',NULL,0),('CHK01',NULL,'BUILDING:FSEC',1,'No. of exists greater than {n} but less than {n}. Needs {s} before {d} ','GENERAL',NULL,0),('FSC01','FSEC_CHECKLIST',NULL,1,'Building exits must abut a public street or approved alley. ','MEANS OF EGRESS ',NULL,1),('FSC02','FSEC_CHECKLIST',NULL,2,'Provide at least two (2) means of egress for each floor, room. ','MEANS OF EGRESS ',NULL,1),('FSC03','FSEC_CHECKLIST',NULL,3,'Provide secondary stair/exit as far/remote from main stair/entrance/exit, to serve _the whole area__. ','MEANS OF EGRESS ',NULL,1),('FSC04','FSEC_CHECKLIST',NULL,4,'Enclose all stairways and fire escapes with walls having {n} hours of fire resistance with access thru self-closing fire doors. ','MEANS OF EGRESS ','d',1),('FSC05','FSEC_CHECKLIST',NULL,5,'Provide two (2) doors as exit ways from all rooms. ','MEANS OF EGRESS ',NULL,1),('FSC06','FSEC_CHECKLIST',NULL,6,'Interconnect stairs and fire escapes with fire resistive passageways on corridors at least {n} meters wide. ','MEANS OF EGRESS ','d',1),('FSC07','FSEC_CHECKLIST',NULL,7,'Enclose walls, doors, stairs ramps, escalators and other components of exits systems. ','MEANS OF EGRESS ',NULL,1),('FSC08','FSEC_CHECKLIST',NULL,8,'Provide protected/enclosed horizontal exits with self-closing fire doors. ','MEANS OF EGRESS ',NULL,1),('FSC09','FSEC_CHECKLIST',NULL,9,'Travel distance to an exit shall not be more than {n}  meters. ','MEANS OF EGRESS','d',1),('FSC10','FSEC_CHECKLIST',NULL,10,'Exit doors shall swing in the direction of exit travel. ','MEANS OF EGRESS ',NULL,1),('FSC11','FSEC_CHECKLIST',NULL,11,'Revolving doors shall not be used as means of egress except {s}','MEANS OF EGRESS ','s',1),('FSC12','FSEC_CHECKLIST',NULL,12,'Exit door should have a minimum width of 71 cm and a maximum width 122 cm and shall not restrict the opening. ','MEANS OF EGRESS ',NULL,1),('FSC13','FSEC_CHECKLIST',NULL,13,'Exit door/s should be openable from the inside without the use of keys, special knowledge or effort flush bolts or surface bolts are prohibited. ','MEANS OF EGRESS ',NULL,1),('FSC14','FSEC_CHECKLIST',NULL,14,'A floor or landing is required not less than the width of exit door. ','MEANS OF EGRESS ',NULL,1),('FSC15','FSEC_CHECKLIST',NULL,15,'Door should be not project into the required corridor width when fully opened so as not to reduced the corridor width to less than 76.17 cm. ','MEANS OF EGRESS ',NULL,1),('FSC16','FSEC_CHECKLIST',NULL,16,'Exit doors should provide immediate access to an approved means of egress. Exiting through a bathroom, bedroom or other room subject to locking does not comply. ','MEANS OF EGRESS ',NULL,1),('FSC17','FSEC_CHECKLIST',NULL,17,'Corridors should have a minimum width of {n} meters. ','MEANS OF EGRESS ','d',1),('FSC18','FSEC_CHECKLIST',NULL,18,'Required corridors in {s} occupancies shall have 2.43 meters (8 ft) minimum width. ','MEANS OF EGRESS ','s',1),('FSC19','FSEC_CHECKLIST',NULL,19,'Dead-end corridors and exit balconies is limited to 6.08 m (20 ft). ','MEANS OF EGRESS ',NULL,1),('FSC20','FSEC_CHECKLIST',NULL,20,'Aisles in auditorium shall be minimum of {n} meters in width. ','MEANS OF EGRESS ','d',1),('FSC21','FSEC_CHECKLIST',NULL,21,'Walls and ceilings of corridors should be fire resistive construction materials. ','MEANS OF EGRESS ',NULL,1),('FSC22','FSEC_CHECKLIST',NULL,22,'Interior openings into corridor should be protected as set forth in {s}. ','MEANS OF EGRESS ','s',1),('FSC23','FSEC_CHECKLIST',NULL,23,'Main stairways should have a minimum width of 112 cm. Trims and handrails should not project more than 8.90 cm (3 1/2 in) into the required width. ','MEANS OF EGRESS ',NULL,1),('FSC24','FSEC_CHECKLIST',NULL,24,'Landings on stairways should have a minimum dimension of 112 cm (44 in) in the direction of travel. ','MEANS OF EGRESS ',NULL,1),('FSC25','FSEC_CHECKLIST',NULL,25,'Risers on stairways should not exceed 19 cm and tread exclusive of nosing or projections should not be less than 25 cm. ','MEANS OF EGRESS ',NULL,1),('FSC26','FSEC_CHECKLIST',NULL,26,'Doors between guests rooms and corridors shall be self-closing and shall have a fire protection rating at least twenty (20) minutes. ','MEANS OF EGRESS ',NULL,1),('FSC27','FSEC_CHECKLIST',NULL,27,'Openings in corridor partitions other than door openings shall be prohibited. ','MEANS OF EGRESS ',NULL,1),('FSC28','FSEC_CHECKLIST',NULL,28,'Basement portion of stairways should be provided with an approved barrier where continuous to upper floor in an exit enclosure. ','MEANS OF EGRESS ',NULL,1),('FSC29','FSEC_CHECKLIST',NULL,29,'Vertical distance between stairway landings are limited to 3.69 m (12 ft) in assembly occupancies, distance is 2.43 m (8 ft) ','MEANS OF EGRESS ',NULL,1),('FSC30','FSEC_CHECKLIST',NULL,30,'Handrails should be placed not less than 81.28 cm (32 in) above the tread. Two (2) handrails are required when stairways exceed 111.7 cm in width. ','MEANS OF EGRESS ',NULL,1),('FSC31','FSEC_CHECKLIST',NULL,31,'Guardrails for stairs, balconies, stair landings, ramps & aisles located along the edge of openside floors and mezzanines shall be provided. ','MEANS OF EGRESS ',NULL,1),('FSC32','FSEC_CHECKLIST',NULL,32,'There shall be no enclosed usable space under the stairs in an exit enclosure nor shall the open space under such stairs be used for any purpose. ','MEANS OF EGRESS ',NULL,1),('FSC33','FSEC_CHECKLIST',NULL,33,'Non-combustible outside stairs are required to have 2.03 m (6 ft, 8 in) minimum headroom clearance for stairways which should be indicated on plans. ','MEANS OF EGRESS ',NULL,1),('FSC34','FSEC_CHECKLIST',NULL,34,'Ramp slopes should have be roughened or with nonslip surface. ','MEANS OF EGRESS ',NULL,1),('FSC35','FSEC_CHECKLIST',NULL,35,'Ramp slopes should not exceed 30.3 cm. (1 ft) in 3.03 m (10 ft.). ','MEANS OF EGRESS ',NULL,1),('FSC36','FSEC_CHECKLIST',NULL,36,'No openings other than the required exits are permitted and exit passageways should be one (1) hr fire resistive construction for a three (3) storey building or less and two (2) hrs for four (4) storey building or more. Any opening therein shall be protected with an approved self-closing fire doors. ','MEANS OF EGRESS ',NULL,1),('FSC37','FSEC_CHECKLIST',NULL,37,'Exit illumination and directional EXIT signs shall be provided. ','MEANS OF EGRESS ',NULL,1),('FSC38','FSEC_CHECKLIST',NULL,38,'Panic hardware is required on exit doors. In lieu of this, doors shall have no locks or latches. ','MEANS OF EGRESS ',NULL,1),('FSC39','FSEC_CHECKLIST',NULL,39,'Provide fire break up to the roof for ceiling areas. ','COMPARTMENTATION ',NULL,1),('FSC40','FSEC_CHECKLIST',NULL,40,'Provide monitored and curtained roof of sheetmetal or non-combustible material of a minimum of 1.82m (6 ft) high spaced not more than 76 m (250 ft) & curtained area limited to a minimum of 4, 630 m2 (50,000 ft2). ','COMPARTMENTATION ',NULL,1),('FSC41','FSEC_CHECKLIST',NULL,41,'Provide smoke partition at enclosed areas of 2, 083 m2 (22, 500 ft2) or less with the length of 45.7m (150 ft) or less, with self-closing fire doors. ','COMPARTMENTATION ',NULL,1),('FSC42','FSEC_CHECKLIST',NULL,42,'Provide partition walls of two (2) hour fire resistance from floor to underside of floor above. ','COMPARTMENTATION ',NULL,1),('FSC43','FSEC_CHECKLIST',NULL,43,'Provide interior finish as follows; Exit; Class {s}   \r\nAccess to Exit; Class {s}                            \r\nOther Spaces;  Class {s}','COMPARTMENTATION ','s,s,s',1),('FSC44','FSEC_CHECKLIST',NULL,44,'Provide fire stopping for all concealed spaces.  ','COMPARTMENTATION ',NULL,1),('FSC45','FSEC_CHECKLIST',NULL,45,'Provide standard fire wall with at least 100 cm (39.38 in) high parapets on all portion of the building on the property line. ','WALLS',NULL,1),('FSC46','FSEC_CHECKLIST',NULL,46,'Extend exterior masonry walls to form parapets or wings.','WALLS',NULL,1),('FSC47','FSEC_CHECKLIST',NULL,47,'Provide protection of all exterior walls. All exterior walls facing approved alleys which are dead-ended must have a fire resistance of {n} hours. ','WALLS','d',1),('FSC48','FSEC_CHECKLIST',NULL,48,'Provide automatic fire dampers on wall openings. ','WALLS',NULL,1),('FSC49','FSEC_CHECKLIST',NULL,49,'Provide protection of all walls. All exterior walls facing approved alleys which are dead-ended must have a fire dampers of {0} hours.','WARNING SYSTEMS',NULL,1),('FSC50','FSEC_CHECKLIST',NULL,50,'Provide approved type heat and smoke detection system. ','WARNING SYSTEMS',NULL,1),('FSC51','FSEC_CHECKLIST',NULL,51,'Provide efficient communication system for warning occupants and calling fire department. ','WARNING SYSTEMS',NULL,1),('FSC52','FSEC_CHECKLIST',NULL,52,'Provide approved type portable fire extinguisher (dry chemical) ABC type, {n} lbs. capacity for every 200 sq.m of floor area(low hazard), 100 sq. m floor area(moderate hazard) and 75 sq. m floor area(high hazard) areas or 22.8 m (75 ft) travel distance on every floor level. ','FIRE PROTECTION ','d',1),('FSC53','FSEC_CHECKLIST',NULL,53,'Provide {s} with {n} mm riser and coupling of fire department standards with pumps of reliable pressure & connected to an adequate water supply tank. Hose and hose cabinet shall be provided at every hose gate valve on all floors. ','FIRE PROTECTION ','s,d',1),('FSC54','FSEC_CHECKLIST',NULL,54,'Provide Fire Service connection with a standard outlet of 64 mm, and 102 mm dry standpipe, and shall located on a street front. ','FIRE PROTECTION ',NULL,1),('FSC55','FSEC_CHECKLIST',NULL,55,'Provide automatic fire extinguishing system where kitchen equipment is located (Kitchenhood). ','FIRE PROTECTION ',NULL,1),('FSC56','FSEC_CHECKLIST',NULL,56,'Provide automatic chemical extinguishing system on all areas where electronic/electrical equipment are located. ','FIRE PROTECTION ',NULL,1),('FSC57','FSEC_CHECKLIST',NULL,57,'Provide approved-type automatic fire extinguishing system in accordance with NFPA 13.  Approval of system plan is required prior to installation ','FIRE PROTECTION ',NULL,1),('FSC58','FSEC_CHECKLIST',NULL,58,'Provide outside window opening on bedrooms with a clear opening of not less than fifty six (56) cm in least dimension and forty five-hundredths (0.45) m2 in area. The bottom of the window shall be not more than one hundred twenty two (122) cm above the floor. ','MISCELLANEOUS ',NULL,1),('FSC59','FSEC_CHECKLIST',NULL,59,'All liquefied petroleum gas equipment including such equipment installed at utility gas plants shall be installed in accordance with the provisions of NFPA 59. ','MISCELLANEOUS ',NULL,1),('FSC60','FSEC_CHECKLIST',NULL,60,'No grills or any obstruction shall be installed on window openings and/or fire exits. ','MISCELLANEOUS ',NULL,1),('FSC61','FSEC_CHECKLIST',NULL,61,'Provide emergency lighting facilities with automatic transfer switch to AC/DC power source. ','MISCELLANEOUS ',NULL,1),('FSC62','FSEC_CHECKLIST',NULL,62,'Air conditioning ducts 